import Vue from 'vue';
import VueRouter from 'vue-router';
import HomeView from '../views/HomeView.vue';
import Login from '../Login.vue';
import App from '../App.vue';
Vue.use(VueRouter);
var routes = [{
  path: '/',
  name: 'home',
  component: HomeView
}, {
  path: '/loginwithtoken',
  name: 'loginwithtoken',
  component: Login
}, {
  path: '/shop',
  name: 'shop',
  component: App
}];
var router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes: routes
});
export default router;
